column36:
* სკოლებში შეიძლება დაემატოს საგნის ან წრის სახით პროგრამირების საფუძვლები;
* უნივერსიტეტებმა მოაწყონ საშაბათო სკოლები (მაგ.: ისეთი, როგორიც "მზიურს" აქვს);
* ჩატარდეს meetup-ები, ჰაკათონები, ერთჯერადი ლექციები, რომელზეც სკოლის მოსწავლეებს მივიწვევთ და ავუხსნით ზოგადად რა არის კომპიუტერული მეცნიერებები
